import React from 'react'
import styled from 'styled-components'
import logo from '../img/miniLogo-W.png'

export default function NavBar() {
  return (
    <NavBack>
        <Logo src={logo}/>
    </NavBack>
  )
}


const NavBack = styled.div`
    background-color: #A27B5C;
    height: 50px;
    width: 100%;
    display: flex;
`;

const Logo = styled.img`
    height: 40px;
    width: auto;
    padding-left: 10px;
    padding-top: 10px;
`;
